import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { NavigationContainer } from '@react-navigation/native';
import { WebView } from 'react-native-webview';

const Tab = createBottomTabNavigator();

export default function App() {
  return (
    <NavigationContainer>

        <Tab.Navigator>
            <Tab.Screen name="React Native" content={RN}></Tab.Screen>
            <Tab.Screen name="Java" content={Java}></Tab.Screen>
            <Tab.Screen name="PHP" content={PHP}></Tab.Screen>
            <Tab.Screen name="JavaScript" content={JS}></Tab.Screen>
        </Tab.Navigator>
    </NavigationContainer>

  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});

function RN(){
  return(
    <iframe width="560" height="315" src="https://www.youtube.com/embed/_LWqxH8EHK0" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
  );
}

function Java(){
  return(
    <iframe width="560" height="315" src="https://www.youtube.com/embed/Wo6bQ6HdU1s" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
  );
}

function PHP(){
  return(
    <iframe width="560" height="315" src="https://www.youtube.com/embed/3tJII8D4Fs0" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
  );
}

function JS(){
  return(
    <iframe width="560" height="315" src="https://www.youtube.com/embed/BXqUH86F-kA" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
  );
}
